import ScrollAnim from 'rc-scroll-anim';

const iniciaScroll = () => {
    setTimeout(() => {
    ScrollAnim
    .scrollScreen
    .init({loop: false, duration: 1000, ease: "easeInOutQuart", scrollInterval: 5800});
    }, 1000);
}

export default iniciaScroll;
